import {Navbar, NavItem, NavLink} from "react-bootstrap";
import {Link} from "react-router-dom";

const Nav = () => {
    return <Navbar>
        <NavItem>
            <NavLink>
                <Link to= "/">Home</Link>
            </NavLink>
        </NavItem>
    </Navbar>
}

export default Nav;
